import './reset.css'
import './App.css';
import './build/main.css'

import Header from './organism/Header'
import { useState } from 'react';
function App() {
  const [data, setData] = useState(null)
  fetch('./data.json').then(
    function (res) {
      return res.json()
    }).then(function (data) {
      setData(data)
    }).catch(
      function (err) {
        console.log(err, "error")
      }
    )


  return (

    <div>
        <Header />
      {

        data? data.map(
      function(data){
            return (<div>
        <h1>{data.brand}</h1>
      </div>)
          }
      ):""
        }

    </div>


  );
}

export default App;
